import React from 'react'
import { RiMenu3Line, RiCloseLin} from 'react-icons/ri';
import './navbar.css';

const NavBar = () => {
  return (
    <div className="reshma__navbar">
      <div className="reshma__navbar-links">
        <div className="reshma__navbar-links_container">
        <p><a href="#home"></a>Reshma Gudla</p>
          <p><a href="#about"></a>About</p>
          <p><a href="#experience"></a>Experience</p>
          <p><a href="#projects"></a>Projects</p>
          <p><a href="#skills"></a>Skills</p>
        </div>
      </div>
    </div>
  )
}

export default NavBar
